import React from 'react'
import './CurrentPlayingSong.css'

function CurrentPlayingSong() {
    return (
        <>
            <img src='unkownAlbum.png' alt='songPlaying' className='CurrentPlayingSong'/>
            <p className='CurrentPlayingSongComponentTitle'>Onwards and Upwards</p>
        </>
    )
}

export default CurrentPlayingSong
